  false,\n\t\"url\": null,\n\t\"notes\": \"This plan outlines developments and activities
  that will take place on St. Marks Refuge during 1933. Improvements will be made
  to buildings, water sources, and boundary marking. Administration activities will
  include wildlife protection, land developments, and grazing. Research will be done
  on nesting birds and turtles. Public relations activities will include cooperating
  with state officials and making Refuge purposes clear. Further studies will be made
  on potential recreations uses on the Refuge.\",\n\t\"license_title\": \"License
